import AppBar from "@mui/material/AppBar";
import Button from "@mui/material/Button";
import Card from "@mui/material/Card";
import CardActions from "@mui/material/CardActions";
import CardContent from "@mui/material/CardContent";
import CardHeader from "@mui/material/CardHeader";
import CardMedia from "@mui/material/CardMedia";
import CssBaseline from "@mui/material/CssBaseline";
import Grid from "@mui/material/Grid";
import Toolbar from "@mui/material/Toolbar";
import Typography from "@mui/material/Typography";
import Container from "@mui/material/Container";
import "./App.css";
import characters from './protagonists.json'
import CharacterCard from './characterCard.js'
import {useEffect, useState} from 'react';









function App() {
  //const [score, setScore] = useState(0)
  console.log('RUN')
  //useEffect( getDog, []);  
  const [dogToShow, setdogToShow] = useState();
  const [breedCorrect, setBreedCorrect] = useState();
  function getDog() {
    const requestOptions = {
        method: "GET",
        redirect: "follow"
      };

      fetch("https://dog.ceo/api/breeds/image/random", requestOptions)
        .then((response) => response.json())
        .then((result) => {

            setdogToShow( result.message)
            setBreedCorrect(result.message.slice('https://images.dog.ceo/breeds/'.length).split('/')[0])
            console.log(breedCorrect)


        })
        .catch((error) => console.error(error))
  }



  const [idea, setIdea] = useState('Click the button and I will you an idea for startup!');
  function ideaStartup() {
    const requestOptions = {
      method: "GET",
      redirect: "follow"
    };

    fetch("https://itsthisforthat.com/api.php?json", requestOptions)
      .then((response) => response.json())
      .then((result) => console.log(result)

    )
      .catch((error) => console.error(error));
  }

  const [counter, setCounter] = useState(0);
  function handleClick() {
    setCounter(counter +1);
    // alert("Click "+ counter +" times")

  }




  return (
    <div className="App">
      <CssBaseline />
      <AppBar
        position="static"
        color="default"
        elevation={0}
        sx={{ borderBottom: "1px solid lightgray" }}
      >
        <Toolbar>
          <Typography variant="h6" sx={{ flexGrow: 1 }}>
            Guess My Breed!
          </Typography>
          <Button
            href="#"
            variant="outlined" 
            sx={{ my: 1, mx: 1.5 }}
            onClick={() => getDog()}
          >
            NEW GAME
          </Button>
          <Button
            href="#"
            variant="outlined" 
            sx={{ my: 1, mx: 1.5 }}
          >
            Score:
          </Button>

        </Toolbar>
      </AppBar>
      <Container maxWidth="md" sx={{ my: 4 }}>




        <Typography
          variant="h5"
          align="center"
          color="text.secondary"
          sx={{ mx: 10 }}
          id = "here"
        >


        </Typography>


      </Container>
      {/* End hero unit */}
      <Container maxWidth="lg" >
        <Grid
          container
          spacing={5}
          justifyContent="center"
          alignItems="flex-start"   
        >

        <Card>
          <CardMedia
          component="img"
          height="350px"
          image = {dogToShow}
          />
        </Card>





        </Grid>

      </Container>
    </div>
  );
}


export default App;
